import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';

const DishesList = ({dishes}) => {

  console.log({dishes})
  return (
    <div>
      {/* Navigation Bar */}
      <nav className="bg-gray-800 text-white p-4">
        <div className="container mx-auto flex justify-between items-center">
          <h1 className="text-xl font-bold">EmptyPocketsEats</h1>
          <ul className="flex space-x-4">
            <li><a href="/">Home</a></li>
            <li><a href="/about">About</a></li>
            <li><a href="/contact">Contact</a></li>
          </ul>
        </div>
      </nav>

      {/* Main Content */}
      <main className="container mx-auto py-8">
        <h2 className="text-3xl font-bold mb-4">Results for Your Search</h2>
        {dishes ? (
          <ul className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {dishes.map(dish => (
              <li key={dish.id} className="border rounded-lg overflow-hidden shadow-lg">
                {dish.image && <img src={dish.image} alt={dish.title} className="w-full h-64 object-cover" />}
                <div className="p-4">
                  <h3 className="text-xl font-semibold mb-2">{dish.title}</h3>
                  <ul className="ingredient-list text-sm">
                    {dish.extendedIngredients.map(ingredient => (
                      <li key={ingredient.id}>{ingredient.original}</li>
                    ))}
                  </ul>
                  <Link to={`/dish/${dish.id}`} className="text-blue-500 hover:underline">View Details</Link>
                </div>
              </li>
            ))}
          </ul>
        ) : (
          <p>Loading...</p>
        )}
      </main>

      {/* Footer */}
      <footer className="bg-gray-800 text-white p-4">
        <div className="container mx-auto text-center">
          <p>Â© 2023 EmptyPocketsEats. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
};

export default DishesList;
